import React from 'react'
import { connect } from 'react-redux'

class DashboardConfig extends React.Component {

    render() {
        const listStyle = {
            listStyle: 'none',
        }
        const listElementStyle = {
            padding: '2rem'
        }
        const user  = this.props.auth.user;
        return(
            <div>
                <ul style={listStyle}>
                    <li style={listElementStyle}>
                        Change name
                    </li>
                    <li>
                        Change surname
                    </li>
                    <li>
                        Change phone
                    </li>
                    <li>
                        Change address
                    </li>
                </ul>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    auth: state.auth
  });

export default connect(mapStateToProps)(DashboardConfig);
